Number.prototype[Symbol.iterator]=function*(){for(let i=1;i<=this.valueOf(); i++){yield i;}};Array.prototype.shuffle=function(){this.forEach((_,i)=>{let random=Math.floor(Math.random()*this.length);[this[random],this[i]]=[this[i],this[random]]});return this};Array.prototype.odd=function(){let t = [...this];t.map((_,i)=>{if(i%2==0){t[i] = undefined}});t.map((e,i)=>{if(e==undefined)t.splice(i,1)});return t};Array.prototype.even=function(){let t = [...this];t.map((_,i)=>{if(i%2!=0){t[i] = undefined}});t.map((e,i)=>{if(e==undefined)t.splice(i,1)});return t};Array.prototype.random=function(){return this[Math.floor(Math.random()*this.length)]};Array.prototype.intersect=function(a){let v=[];this.forEach(e=>{a.forEach((f)=>{if(e===f){v.push(e)}})});return v};Array.prototype.insertAt=function(v,p){let o = [...this];this.push(null);for(let i=p;i<this.length-1;i++){this[i+1]=o[i];}this[p]=v;return this};Array.prototype.removeAt=function(p){let o = [...this];for(let i=this.length-1;i>p;i--){this[i-1]=o[i]}this.pop();return this};Array.prototype.union=function(a){a.forEach(e=>{this.push(e)});return this;};Array.prototype.rotL=function(q){let c=this.length-1;for(let i=0;i<q;i++){this.union(this).shift();this.length -= c;}return this;};Array.prototype.rotR=function(q){let c=this.length-1;for(let i=0;i<q;i++){this.union(this).pop();this.splice(0,c);}return this;};Array.prototype.med=function(){return this.length%2===0?(this[this.length/2-1]+this[this.length/2])/2:this[Math.floor(this.length/2)];};Array.prototype.trend=function(){let h=[...new Set(this)];let t=[...h.length];t.fill(0);h.forEach((e,i)=>{this.forEach(f=>{if(e===f){t[i]++;}})});let m=0;t.forEach(e=>{m=m<e?e:m;});return{trend:h[t.findIndex(p=>p==m)],times:m};};Array.prototype.sortObj=function(p){return this.sort(function(a,b){return a[p]>b[p]?1:a[p]<b[p]?-1:0})};